import React from 'react';
import style from './UpButton.module.css';

export default function UpButton() {
  return <button className={style.up_button}>
    <svg>
          <line x1="50" y1="50" x2="50" y2="100" stroke="#765373" strokeWidth="3"/>
          <line x1="80" y1="5" x2="5" y2="80" stroke="#765373" strokeWidth="3"/>
          <line x1="100" y1="25" x2="25" y2="100" stroke="#765373" strokeWidth="3"/>
        </svg>
  </button>;
}
